import React from 'react'
import '../Pages/styles.css'
import '../App.css'
import Landing from './Landing'

const Service =(props) => {

    function handleClick(e) {
        e.preventDefault()
        if (e.target.value === "Water tank fill") {
            props.setService('Water tank fill')
        } 
        if (e.target.value === "Water tank cleaning") {
            props.setService('Water tank fill')
        }
        props.setFormStep(1)
    }

    return (
    <div className="card">
        <Landing />
        <div className="authBox">
            <h1>Choose a service</h1>
            <div className="servicesBox">
                <input className="btn-primary" type="submit" value="Water tank fill" onClick={handleClick}/>
                <input className="btn-primary" type="submit" value="Water tank cleaning" onClick={handleClick}/>
            </div>

        </div>
    </div>
    )
}

export default Service
